;; **
;;; Now, we draw some samples and plot them.
;; **

;; @@
(defn draw-samples [n-samples thin]
  "simple helper to draw samples and thin them; throw out 50% as burnin"
  (drop n-samples 
        (take (* 2 n-samples)
              (take-nth thin (doquery :pgibbs gmm [X {:K 5}] :number-of-particles thin)))))

;; draw samples; thin
(time (def samples (doall (draw-samples 10 1000))))
;; @@
;; ->
;;; provided hyperparameters: {:K 5}
;;; &quot;Elapsed time: 120510.941 msecs&quot;
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris/samples</span>","value":"#'gmm-iris/samples"}
;; <=

;; @@
;; plot them, each; see how the samples evolve?
(map (fn [sample]
       (let [y-hat (:z (get-predicts sample))]
         (plot-pca X y-hat #(get colors %))))
     samples)
